import React from "react";
import "./ExpenseItem.css"; // Assuming you're using external CSS

const App = () => {
  return (
    <div className="app">
      <Sidebar />
      <MainContent />
    </div>
  );
};

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="logo">
        <img src="logo.png" alt="Logo" /> {/* Replace with your logo */}
      </div>
      <nav>
        <ul>
          <li>
            <i className="icon-home"></i>
          </li>
          <li>
            <i className="icon-book"></i>
          </li>
          <li>
            <i className="icon-users"></i>
          </li>
          <li>
            <i className="icon-settings"></i>
          </li>
        </ul>
      </nav>
    </div>
  );
};

const MainContent = () => {
  return (
    <div className="main-content">
      <Header />
      <Content />
    </div>
  );
};

const Header = () => {
  return (
    <header className="header">
      <div className="progress-bar">
        <div className="progress" style={{ width: "10%" }}></div>{" "}
        {/* Adjust width based on progress */}
      </div>
    </header>
  );
};

const Content = () => {
  return (
    <div className="content">
      <TableOfContents />
      <ModuleContent />
    </div>
  );
};

const TableOfContents = () => {
  return (
    <div className="table-of-contents">
      <h2>Table of Contents</h2>
      <section>
        <div className="section-title">Section One Title</div>
        <ul>
          <li>Module One</li>
          <li>Module Two</li>
          <li>Module Three</li>
          <li>Quiz</li>
        </ul>
      </section>
      <section>
        <div className="section-title">Section Two Title</div>
      </section>
      <section>
        <div className="section-title">Section Three Title</div>
      </section>
    </div>
  );
};

const ModuleContent = () => {
  return (
    <div className="module-content">
      <h2>Module Title</h2>
      <div className="module-slide">
        <p>
          Technology has revolutionized the way we live, work, and
          communicate...
        </p>
        <div className="slide-controls">
          <button>&lt;</button>
          <span>1/10</span>
          <button>&gt;</button>
        </div>
      </div>
    </div>
  );
};

export default App;
